import React from 'react'


const SearchListItem = ({course, cart, setCart}) => {

    let getId = () => {
        return course.id
    }

    let getTitle = () => {
        return course.title
    }

    // let addCourse = async () => {
    //     console.log('Button! Course :' + course.id)
    //     await cart.push(course)
    //     await setCart(cart)
    // }
    return (
        <div className = "search-list-item">
            <button onClick = {() => setCart(course)}> + </button>
            <h3>{getId()}</h3>
            <p>{getTitle()}</p>
        </div>
    )
}

export default SearchListItem
